import React from "react"
import * as ReactDOMClient from 'react-dom/client';
import ReactDOM from "react-dom"


const inputClick = () => console.log('click')
const mouseEnter = () => console.log('mouse')

const helpText =  "Help >>text"

class Shapka extends React.Component {
  render() {
    return (
      <div>


        <p>PARUS IS CAPITAL OF {9+8}</p>
        <input placeholder="BEK LOASHANDRDA"></input>
      </div>
    )
  }
} 


class App extends React.Component {
  render() {
    return (
      <div className='name'>
      <Shapka />
<h1>{helpText}</h1>
<input placeholder={helpText} onClick={inputClick} onMouseEnter = {mouseEnter}/>
<p>{helpText==="Help >>text" ? "yes" : "no"}</p>
    </div>
    )
  }
}



const app = ReactDOMClient.createRoot(document.getElementById('app'))
